.app-logo {
    position: absolute;
    background: var(--logo-image) top center/auto 50% no-repeat;
    width: 256px;
    height: 256px;
    background-size: contain;
    top: 56%;
    left: 50%;
    transform: translate(-50%, -50%);
}
.bottom-logo {
    position: absolute;
    background: var(--tripledot-image) no-repeat;
    width: 20vw;
    height: 20vw;
    max-width: 64px;
    max-height: 64px;
    background-size: contain;
    top: 87%;
    left: 49%;
    transform: translate(-50%, -50%);
}
.load-text {
    position: absolute;
    top: 66%;
    width: 100%;
    text-align: center;
    font-size: 15px;
    color: azure;
    font-family: sans-serif;
    font-weight: 800;
    letter-spacing: 1px;
    text-shadow: 3px 1px 1px black;
}</style></head>
